import React, { useEffect, useState } from 'react';
import Card from '../Card/Card.js';

const Cards = ({ startIndex, endIndex, busqueda }) => {
    const [existe, setExiste] = useState(false);

    useEffect(() => {
        if (busqueda.length === 0) {
            setExiste(false); // Si no hay datos, cambiar el estado a `false`
        } else {
            setExiste(true);
        }
    }, [busqueda]);

    return (
        <div>
            {existe === true ? (
                busqueda.slice(startIndex, endIndex).map((element, index) => (
                    <Card
                        key={index}
                        name={element.name}
                        lifeSpan={element.life_span}
                        temperament={element.temperament}
                        url={element.url}
                    />
                ))
            ) : (
                <div className='verificar'>
                    <h1 className='sinJuego'></h1>
                    <img
                        className='imgSinjuego'
                        src={Nohaydatos}
                        alt='No se encontraron datos'
                    />
                </div>
            )}
        </div>
    );
};

export default Cards;
